/**
 * Run a stream data through a pipeline of stream transformers.
 * @template T
 * @param {ReadableStream<T>} source
 * @param {(Transformer|null)[]} transformers
 * @returns {any}
 */
export function pipelineStream<T>(source: ReadableStream<T>, transformers: (Transformer | null)[]): any;
/**
 * Synchronously run a batch of data through a pipeline of stream transformers.
 * @template T
 * @param {T} source
 * @param {(Transformer|null)[]} transformers
 * @returns {any}
 */
export function pipelineSync<T>(source: T, transformers: (Transformer | null)[]): any;
